package com.hunter.sys.entity;import com.hunter.base.entity.BaseEntity;/** * @Author zhangcl * @Date 16/7/9  下午5:56 */public class SysUserEntity extends BaseEntity {    private String code;    private String name;    private String phone;    public String getCode() {        return code;    }    public void setCode(String code) {        this.code = code;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getPhone() {        return phone;    }    public void setPhone(String phone) {        this.phone = phone;    }    @Override    public String toString() {        return "SysUserEntity{" +                "code='" + code + '\'' +                ", name='" + name + '\'' +                ", phone='" + phone + '\'' + super.toString() +                '}';    }}